"use strict";const $form=document.querySelector(".js-add-note-form"),$inputs={title:document.querySelector("#title"),content:document.querySelector("#content")},baseUrl="http://localhost:3000/notes",isValid=()=>""!==$inputs.title.value&&""!==$inputs.content.value,submitForm=t=>{if(t.preventDefault(),isValid()){const t=new FormData($form);fetch(baseUrl,{method:"PUT",body:t}).then(t=>{console.log(t)}).catch(t=>{console.log(t)})}},init=()=>{$form.addEventListener("submit",submitForm,!1)};document.addEventListener("DOMContentLoaded",init,!1);